  `gmt_reply` datetime DEFAULT NULL COMMENT '回复时间',
  `is_delete` int(2) DEFAULT '0' COMMENT '是否删除 0 未删除 1 已删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

